import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './ProductGrid.css';

import i1 from '../src/images/img1.jpg';
import i2 from '../src/images/img2.jpg';
import i3 from '../src/images/img3.jpg';
import i4 from '../src/images/img4.jpg';
import i5 from '../src/images/img5.jpg';
import i6 from '../src/images/img6.jpg';
import i7 from '../src/images/img7.jpg';
import i8 from '../src/images/img8.jpg';
import i9 from '../src/images/img9.jpg';
import i10 from '../src/images/img10.jpg';
import i11 from '../src/images/img11.jpg';
import i12 from '../src/images/img12.jpg';
import i13 from '../src/images/img13.jpg';
import i14 from '../src/images/img14.jpg';
import i15 from '../src/images/img15.jpg';
import i16 from '../src/images/img16.jpg';
import i17 from '../src/images/img17.jpg';
import i18 from '../src/images/img18.jpg';
import i19 from '../src/images/img19.jpg';
import i20 from '../src/images/img20.jpg';
import i21 from '../src/images/img21.jpg';
import i22 from '../src/images/img22.jpg';
import i23 from '../src/images/img23.jpg';
import i24 from '../src/images/img24.jpg';
import i25 from '../src/images/img25.jpg';
import i26 from '../src/images/img26.jpg';
import i27 from '../src/images/img27.jpg';
import i28 from '../src/images/img28.jpg';
import i29 from '../src/images/img29.jpg';
import i30 from '../src/images/img30.jpg';












// Import images
// import i1 from './img.JPG';
import altSlider1 from './img2.jpg'; 
import altSlider3 from './slider3.webp'; 





const products = [
  {
    id: 1,
    imgSrc: slider1,
    altImgSrc: altSlider1,
    categories: ['Maternity', 'New'],
    title: 'Shady Blooms',
    price: 'Rs. 1,199.00 - Rs. 1,299.00',
    sizes: ['S', 'M', 'L', 'XL', 'XXL'],
    rating: 5,
  },
  {
    id: 1,
    imgSrc: slider1,
    altImgSrc: altSlider3,
    categories: ['Maternity', 'New'],
    title: 'Shady Blooms',
    price: 'Rs. 1,199.00 - Rs. 1,299.00',
    sizes: ['S', 'M', 'L', 'XL', 'XXL'],
    rating: 5,
  },
  {
    id: 1,
    imgSrc: slider1,
    altImgSrc: altSlider1,
    categories: ['Maternity', 'New'],
    title: 'Shady Blooms',
    price: 'Rs. 1,199.00 - Rs. 1,299.00',
    sizes: ['S', 'M', 'L', 'XL', 'XXL'],
    rating: 5,
  },
  {
    id: 1,
    imgSrc: slider1,
    altImgSrc: altSlider1,
    categories: ['Maternity', 'New'],
    title: 'Shady Blooms',
    price: 'Rs. 1,199.00 - Rs. 1,299.00',
    sizes: ['S', 'M', 'L', 'XL', 'XXL'],
    rating: 5,
  },
  
];

const ProductGrid = () => {
  const [hoveredIndex, setHoveredIndex] = useState(null);
  const navigate = useNavigate();

  const handleMouseEnter = (index) => {
    setHoveredIndex(index);
  };

  const handleMouseLeave = () => {
    setHoveredIndex(null);
  };

  const handleClick = (product) => {
    navigate('/completeview', { state: { product } });
  };


  

  return (
    <div className="product-grid">
      <h2>New Arrivals</h2>
      <div className="products">
        {products.map((product, index) => (
          <div
            key={product.id}
            className="product-card"
            onMouseEnter={() => handleMouseEnter(index)}
            onMouseLeave={handleMouseLeave}
            onClick={() => handleClick(product)}
          >
            <div className="image-container">
              <img
                src={
                  hoveredIndex === index && product.altImgSrc
                    ? product.altImgSrc
                    : product.imgSrc
                }
                alt={product.title}
                className="product-image"
              />
              
              <div className="categories">
                {product.categories.map((category, i) => (
                  <span key={i} className="category">{category}</span>
                ))}
              </div>
            </div>
            <div className="product-details">
              <h3>{product.title}</h3>
              <p>{product.price}</p>
              <div className="rating">
                {'⭐'.repeat(product.rating)}
              </div>
              <div className="sizes">
                {product.sizes.map(size => (
                  <span key={size} className="size">{size}</span>
                ))}
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ProductGrid;
